import React from 'react';

const TextInput = ({ 
  value, 
  onChange, 
  placeholder = '', 
  type = 'text', 
  className = '',
  ...props 
}) => {
  return (
    <input
      type={type}
      className={`form-control ${className}`}
      value={value}
      onChange={onChange}
      placeholder={placeholder}
      {...props}
    />
  );
};

export default TextInput;
